return{
  Collapse:function(t){
    this.toggle=function(){
      const e=document.querySelector(t);
      if(e){
        if(e.classList.contains("show")){
          e.classList.remove("show");
        }else{
          e.classList.add("show");
        }
      }
    };
  },
  Dropdown:function(t){
    this.toggle=function(){
      const e=document.querySelector(t);
      if(e){
        if(e.classList.contains("show")){
          e.classList.remove("show");
        }else{
          e.classList.add("show");
        }
      }
    };
  },
  Modal:function(t){
    this.show=function(){
      const e=document.querySelector(t);
      if(e){
        e.classList.add("show");
        e.style.display="block";
      }
    };
    this.hide=function(){
      const e=document.querySelector(t);
      if(e){
        e.classList.remove("show");
        e.style.display="none";
      }
    };
  },
  Alert:function(t){
    this.close=function(){
      const e=document.querySelector(t);
      if(e){
        e.remove();
      }
    };
  }
};
